import React, { useEffect, useState } from 'react';
import logo from './logo.svg';
import styles from './App.module.scss';
import axios from 'axios';
import Table from './Table';

function App() {
  const [result, setResult] = useState('');
  const [time, setTime] = useState(new Date()); // {Math.floor(time.getTime() / 1000)}

  useEffect(() => {
    setInterval(() => {
      setTime(new Date());
    }, 1000);
  }, []);

  useEffect(() => {
    axios
      .get('http://localhost:5000/submit/eunlin')
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <div className={styles['App']}>
      <div className={styles['App-header']}>
        <div className={styles['content']}>
          <div className={styles['text-head']}>
            {Math.floor(
              (Math.floor(time.getTime() / 1000) - 1705244400) / 604800,
            ) + 1}
            주차 스터디
          </div>
          <div className={styles['text-body']}>
            {time.toLocaleString('ko-KR', {
              dateStyle: 'full',
              timeStyle: 'medium',
              hour12: true,
            })}
          </div>
        </div>
        <Table />
      </div>
    </div>
  );
}

export default App;
